import React from 'react';
import {Card, Button, Image} from 'react-bootstrap';
import '../../src/app.css';

import Compass from "../resources/icons/50w/XMCompass_50px.png";
import Pawprint from "../resources/icons/100w/XMPawprint_100px.png";
import Book from "../resources/icons/150w/XMBook_150px.png";
import Team from "../resources/icons/100w/XMTeam_100px.png";
import Contact from "../resources/icons/100w/XMContact_100px.png";


class Sidebar extends React.Component{
    render(){
        return(
        <div className="main-sidebar">
            <Button class="sidebar-button" variant="sidebarbutton"><Image src={Compass}/></Button>
            <Button class="sidebar-button" variant="sidebarbutton"><Image src={Pawprint}/></Button>
            <Button class="sidebar-button" variant="sidebarbutton"><Image src={Book}/></Button>
            <Button class="sidebar-button" variant="sidebarbutton"><Image src={Team}/></Button>
            <Button class="sidebar-button" variant="sidebarbutton"><Image src={Contact}/></Button>
        </div>
        );


    }    
    
}

export default Sidebar;
